  \"In situ, meteorological, navigational, physical and profile data collected by
  US DOC; NOAA; NWS; National Data Buoy Center at OceanSITES site T2N180W from 1997-06-25
  to 2015-08-06 (NCEI Accession 0130848)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:03.858163\",\n\t\"name\": \"in-situ-meteorological-navigational-physical-and-profile-data-collected-by-us-doc-noaa-nws-956f1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In situ, meteorological, navigational,
  physical and profile oceanographic data were collected, including AIR TEMPERATURE,
  DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, RELATIVE HUMIDITY,
  SALINITY, SEA SURFACE TEMPERATURE, SIGMA-THETA, WATER TEMPERATURE, WIND DIRECTION
  and WIND SPEED from Moored Buoy at the TAO/TRITON Site 2N 180W (T2N180W) using GPS,
  anemometer, conductivity sensor, meteorological sensors, pressure sensors and thermistor
  from 1997-06-25 to 2015-08-06. These data were provided to one of the OceanSITES
  Data Assembly Centers (DAC). The DAC formatted this information into the OceanSITES
  file format and passed it on to the Global Data Assembly Centers (GDAC).OceanSITES
  is a worldwide system of long-term, open-ocean reference stations measuring dozens
  of variables and monitoring the full depth of the ocean from air-sea interactions
  down to the seafloor. It is a network of stations or observatories measuring many
  aspects of the ocean's surface and water column using, where possible, automated
  systems with advanced sensors and telecommunications systems, yielding high time
  resolution, often in real-time, while building a long record.\",\n\t\"license_title\":
